Certain dbcrossbar types can be specified by adding the following declarations to a TypeScript file: // Decimal numbers which can exactly represent
// currency values with no rounding.
type decimal = number | string; // Integers of various sizes.
type int16 = number | string;
type int32 = number | string;
type int64 = number | string; These may then be used as follows: interface OrderItem { id: int64, sku: string, unit_price: decimal, quantity: int16,
} When the TypeScript schema is converted to a portable dbcrossbar schema, the "magic" types will be replaced with the corresponding portable type.

81.body:
We also support nullable values, arrays and nested structures: type decimal = number | string;
type int16 = number | string;
type int32 = number | string;
type int64 = number | string; interface Order { id: int64, line_items: OrderItem[], note: string | null,
} interface OrderItem { id: int64, sku: string, unit_price: decimal, quantity: int16,
} Nested arrays and structs will translate to appropriate database-specific types, such as BigQuery ARRAY and STRUCT types.
